INSERT INTO public.products (id, count, description, title, preview_image_id, price, discount_price, base64image, category, category_order) VALUES (2703, 4, 'Смартфон Apple iPhone 14 со встроенной памятью 128 Гб оснащен экраном диагональю 6,1 дюйма, выполненным по технологии OLED. Дисплей типа Super Retina XDR обладает разрешением 2532x1170 пикселей. В этой модели установлен шестиядерный процессор А15 Bionic. В девайсе используются две SIM-карты формата nano.', 'Смартфон Apple IPhone 14', 853, 72990, 65700, NULL, 'Смартфоны/Apple', '1,1') ON CONFLICT DO NOTHING;
INSERT INTO public.products (id, count, description, title, preview_image_id, price, discount_price, base64image, category, category_order) VALUES (2704, 9, 'Смартфон Samsung Galaxy S23 — модель с безрамочным экраном диагональю 6,1 дюйма, выполненным по технологии Dynamic AMOLED 2X. Разрешение — 2400x1080 пикселей, частота обновления — 120 Гц. Отображается 16 млн цветов.', 'Смартфон Samsung Galaxy S23', 854, 76990, 69300, NULL, 'Смартфоны/Samsung', '1,2') ON CONFLICT DO NOTHING;
INSERT INTO public.products (id, count, description, title, preview_image_id, price, discount_price, base64image, category, category_order) VALUES (2702, 13, 'Смартфон Apple iPhone 15  (Dual Sim) получил дисплей диагональю 6,1 дюйма, выполненный по технологии Super Retina XDR. Разрешение — 2556x1179 пикселей, яркость достигает 2000 нит, контрастность составляет 2000000:1 — изображение четкое, детализированное и насыщенное. Частота обновления 60 Гц обеспечивает плавность отображения любого динамичного контента.', 'Смартфон Apple IPhone 15', 852, 81990, 73800, 'йцукйцукйц', 'Смартфоны/Apple', '1,1') ON CONFLICT DO NOTHING;
INSERT INTO public.products (id, count, description, title, preview_image_id, price, discount_price, base64image, category, category_order) VALUES (2705, 3, 'Флагманский смартфон Huawei Mate 50 Pro,  на ОС Android (оболочка Emui 13) представлен в защищенном по стандарту IP 68 корпусе из металла и закаленного стекла габаритами 162х76х8,5 мм. Размер оперативной памяти девайса — 8 Гб, встроенной — 256 Гб. ', 'Смартфон Huawei Mate 50 Pro', 855, 49990, 45000, NULL, 'Смартфоны', '1,4') ON CONFLICT DO NOTHING;
INSERT INTO public.products (id, count, description, title, preview_image_id, price, discount_price, base64image, category, category_order) VALUES (2706, 6, 'Чехол из прочного пластика с патриотичным дизайном', 'Чехол для Huawei Mate 50 Pro', 856, 4990, 4000, NULL, 'Смартфоны/Сопутствующие товары/Чехлы', '1,3,2') ON CONFLICT DO NOTHING;
INSERT INTO public.products (id, count, description, title, preview_image_id, price, discount_price, base64image, category, category_order) VALUES (2707, 5, 'Умная колонка Яндекс Станция Мини с часами с Алисой представлена в ярком цвете мутный  белый.  Алиса вовремя разбудит, напомнит о важных делах, сообщит последние новости, включит любимую композицию или предложит новый плейлист, расскажет детям интересную историю. Станция имеет яркий и мощный звук благодаря динамику 10 Вт. ', 'Умная колонка Яндекс Станция', 857, 9990, 8000, NULL, 'Аудиотехника/Портативные колонки', '3,1') ON CONFLICT DO NOTHING;
INSERT INTO public.products (id, count, description, title, preview_image_id, price, discount_price, base64image, category, category_order) VALUES (2708, 5, 'Наушники Apple AirPods Pro  — модель типа вкладыши в корпус из пластика, амбушюры сделаны из силикона. Благодаря стандарту IPX4 модель не боится попадания воды. ', 'Наушники Apple AirPods Pro', 858, 27990, 24300, NULL, 'Смартфоны/Сопутствующие товары/Наушники,Аудиотехника/Наушники', '1,3,1/3,2') ON CONFLICT DO NOTHING;


